# https://leetcode.com/problems/repeated-string-match/
# Google

def repeated_string_match(A, B):   

    len1 = len(A)
    len2 = len(B)

    ratio = len2//len1

    for i in range(ratio, ratio+2):
        copy = A*i

        if B in copy:
            print(i)
    
    print(-1)


A = ""
B = ""
repeated_string_match(A, B)
